<html data-reactroot="" data-reactid="1" data-react-checksum="524275646" lang="en" data-react-helmet="lang"><head data-reactid="2"><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"><title data-reactid="4"></title><meta content="width=device-width, initial-scale=1, minimal-ui" name="viewport" data-reactid="5"><meta content="IE=Edge" http-equiv="X-UA-Compatible" data-reactid="6"><link href="https://data.worldbank.org/favicon.ico?v=1.1" rel="shortcut icon" data-reactid="7"><meta name="google-site-verification" content="ByFDZmo3VoJURCHrA3WHjth6IAISYQEbe20bfzTPCPo" data-reactid="8"><link href="./main-eb5d2e8ea4bd5b279e03.css" media="screen, projection" rel="stylesheet" type="text/css" data-reactid="9"><style type="text/css">/* required styles */

.leaflet-pane,
.leaflet-tile,
.leaflet-marker-icon,
.leaflet-marker-shadow,
.leaflet-tile-container,
.leaflet-pane > svg,
.leaflet-pane > canvas,
.leaflet-zoom-box,
.leaflet-image-layer,
.leaflet-layer {
	position: absolute;
	left: 0;
	top: 0;
	}
.leaflet-container {
	overflow: hidden;
	}
.leaflet-tile,
.leaflet-marker-icon,
.leaflet-marker-shadow {
	-webkit-user-select: none;
	   -moz-user-select: none;
	        user-select: none;
	  -webkit-user-drag: none;
	}
/* Prevents IE11 from highlighting tiles in blue */
.leaflet-tile::selection {
	background: transparent;
}
/* Safari renders non-retina tile on retina better with this, but Chrome is worse */
.leaflet-safari .leaflet-tile {
	image-rendering: -webkit-optimize-contrast;
	}
/* hack that prevents hw layers "stretching" when loading new tiles */
.leaflet-safari .leaflet-tile-container {
	width: 1600px;
	height: 1600px;
	-webkit-transform-origin: 0 0;
	}
.leaflet-marker-icon,
.leaflet-marker-shadow {
	display: block;
	}
/* .leaflet-container svg: reset svg max-width decleration shipped in Joomla! (joomla.org) 3.x */
/* .leaflet-container img: map is broken in FF if you have max-width: 100% on tiles */
.leaflet-container .leaflet-overlay-pane svg,
.leaflet-container .leaflet-marker-pane img,
.leaflet-container .leaflet-shadow-pane img,
.leaflet-container .leaflet-tile-pane img,
.leaflet-container img.leaflet-image-layer,
.leaflet-container .leaflet-tile {
	max-width: none !important;
	max-height: none !important;
	}

.leaflet-container.leaflet-touch-zoom {
	-ms-touch-action: pan-x pan-y;
	touch-action: pan-x pan-y;
	}
.leaflet-container.leaflet-touch-drag {
	-ms-touch-action: pinch-zoom;
	/* Fallback for FF which doesn't support pinch-zoom */
	touch-action: none;
	touch-action: pinch-zoom;
}
.leaflet-container.leaflet-touch-drag.leaflet-touch-zoom {
	-ms-touch-action: none;
	touch-action: none;
}
.leaflet-container {
	-webkit-tap-highlight-color: transparent;
}
.leaflet-container a {
	-webkit-tap-highlight-color: rgba(51, 181, 229, 0.4);
}
.leaflet-tile {
	filter: inherit;
	visibility: hidden;
	}
.leaflet-tile-loaded {
	visibility: inherit;
	}
.leaflet-zoom-box {
	width: 0;
	height: 0;
	-moz-box-sizing: border-box;
	     box-sizing: border-box;
	z-index: 800;
	}
/* workaround for https://bugzilla.mozilla.org/show_bug.cgi?id=888319 */
.leaflet-overlay-pane svg {
	-moz-user-select: none;
	}

.leaflet-pane         { z-index: 400; }

.leaflet-tile-pane    { z-index: 200; }
.leaflet-overlay-pane { z-index: 400; }
.leaflet-shadow-pane  { z-index: 500; }
.leaflet-marker-pane  { z-index: 600; }
.leaflet-tooltip-pane   { z-index: 650; }
.leaflet-popup-pane   { z-index: 700; }

.leaflet-map-pane canvas { z-index: 100; }
.leaflet-map-pane svg    { z-index: 200; }

.leaflet-vml-shape {
	width: 1px;
	height: 1px;
	}
.lvml {
	behavior: url(#default#VML);
	display: inline-block;
	position: absolute;
	}


/* control positioning */

.leaflet-control {
	position: relative;
	z-index: 800;
	pointer-events: visiblePainted; /* IE 9-10 doesn't have auto */
	pointer-events: auto;
	}
.leaflet-top,
.leaflet-bottom {
	position: absolute;
	z-index: 1000;
	pointer-events: none;
	}
.leaflet-top {
	top: 0;
	}
.leaflet-right {
	right: 0;
	}
.leaflet-bottom {
	bottom: 0;
	}
.leaflet-left {
	left: 0;
	}
.leaflet-control {
	float: left;
	clear: both;
	}
.leaflet-right .leaflet-control {
	float: right;
	}
.leaflet-top .leaflet-control {
	margin-top: 10px;
	}
.leaflet-bottom .leaflet-control {
	margin-bottom: 10px;
	}
.leaflet-left .leaflet-control {
	margin-left: 10px;
	}
.leaflet-right .leaflet-control {
	margin-right: 10px;
	}


/* zoom and fade animations */

.leaflet-fade-anim .leaflet-tile {
	will-change: opacity;
	}
.leaflet-fade-anim .leaflet-popup {
	opacity: 0;
	-webkit-transition: opacity 0.2s linear;
	   -moz-transition: opacity 0.2s linear;
	        transition: opacity 0.2s linear;
	}
.leaflet-fade-anim .leaflet-map-pane .leaflet-popup {
	opacity: 1;
	}
.leaflet-zoom-animated {
	-webkit-transform-origin: 0 0;
	    -ms-transform-origin: 0 0;
	        transform-origin: 0 0;
	}
.leaflet-zoom-anim .leaflet-zoom-animated {
	will-change: transform;
	}
.leaflet-zoom-anim .leaflet-zoom-animated {
	-webkit-transition: -webkit-transform 0.25s cubic-bezier(0,0,0.25,1);
	   -moz-transition:    -moz-transform 0.25s cubic-bezier(0,0,0.25,1);
	        transition:         transform 0.25s cubic-bezier(0,0,0.25,1);
	}
.leaflet-zoom-anim .leaflet-tile,
.leaflet-pan-anim .leaflet-tile {
	-webkit-transition: none;
	   -moz-transition: none;
	        transition: none;
	}

.leaflet-zoom-anim .leaflet-zoom-hide {
	visibility: hidden;
	}


/* cursors */

.leaflet-interactive {
	cursor: pointer;
	}
.leaflet-grab {
	cursor: -webkit-grab;
	cursor:    -moz-grab;
	cursor:         grab;
	}
.leaflet-crosshair,
.leaflet-crosshair .leaflet-interactive {
	cursor: crosshair;
	}
.leaflet-popup-pane,
.leaflet-control {
	cursor: auto;
	}
.leaflet-dragging .leaflet-grab,
.leaflet-dragging .leaflet-grab .leaflet-interactive,
.leaflet-dragging .leaflet-marker-draggable {
	cursor: move;
	cursor: -webkit-grabbing;
	cursor:    -moz-grabbing;
	cursor:         grabbing;
	}

/* marker & overlays interactivity */
.leaflet-marker-icon,
.leaflet-marker-shadow,
.leaflet-image-layer,
.leaflet-pane > svg path,
.leaflet-tile-container {
	pointer-events: none;
	}

.leaflet-marker-icon.leaflet-interactive,
.leaflet-image-layer.leaflet-interactive,
.leaflet-pane > svg path.leaflet-interactive,
svg.leaflet-image-layer.leaflet-interactive path {
	pointer-events: visiblePainted; /* IE 9-10 doesn't have auto */
	pointer-events: auto;
	}

/* visual tweaks */

.leaflet-container {
	background: #ddd;
	outline: 0;
	}
.leaflet-container a {
	color: #0078A8;
	}
.leaflet-container a.leaflet-active {
	outline: 2px solid orange;
	}
.leaflet-zoom-box {
	border: 2px dotted #38f;
	background: rgba(255,255,255,0.5);
	}


/* general typography */
.leaflet-container {
	font: 12px/1.5 "Helvetica Neue", Arial, Helvetica, sans-serif;
	}


/* general toolbar styles */

.leaflet-bar {
	box-shadow: 0 1px 5px rgba(0,0,0,0.65);
	border-radius: 4px;
	}
.leaflet-bar a,
.leaflet-bar a:hover {
	background-color: #fff;
	border-bottom: 1px solid #ccc;
	width: 26px;
	height: 26px;
	line-height: 26px;
	display: block;
	text-align: center;
	text-decoration: none;
	color: black;
	}
.leaflet-bar a,
.leaflet-control-layers-toggle {
	background-position: 50% 50%;
	background-repeat: no-repeat;
	display: block;
	}
.leaflet-bar a:hover {
	background-color: #f4f4f4;
	}
.leaflet-bar a:first-child {
	border-top-left-radius: 4px;
	border-top-right-radius: 4px;
	}
.leaflet-bar a:last-child {
	border-bottom-left-radius: 4px;
	border-bottom-right-radius: 4px;
	border-bottom: none;
	}
.leaflet-bar a.leaflet-disabled {
	cursor: default;
	background-color: #f4f4f4;
	color: #bbb;
	}

.leaflet-touch .leaflet-bar a {
	width: 30px;
	height: 30px;
	line-height: 30px;
	}
.leaflet-touch .leaflet-bar a:first-child {
	border-top-left-radius: 2px;
	border-top-right-radius: 2px;
	}
.leaflet-touch .leaflet-bar a:last-child {
	border-bottom-left-radius: 2px;
	border-bottom-right-radius: 2px;
	}

/* zoom control */

.leaflet-control-zoom-in,
.leaflet-control-zoom-out {
	font: bold 18px 'Lucida Console', Monaco, monospace;
	text-indent: 1px;
	}

.leaflet-touch .leaflet-control-zoom-in, .leaflet-touch .leaflet-control-zoom-out  {
	font-size: 22px;
	}

/* attribution and scale controls */

.leaflet-container .leaflet-control-attribution {
	background: #fff;
	background: rgba(255, 255, 255, 0.7);
	margin: 0;
	}
.leaflet-control-attribution,
.leaflet-control-scale-line {
	padding: 0 5px;
	color: #333;
	}
.leaflet-control-attribution a {
	text-decoration: none;
	}
.leaflet-control-attribution a:hover {
	text-decoration: underline;
	}
.leaflet-container .leaflet-control-attribution,
.leaflet-container .leaflet-control-scale {
	font-size: 11px;
	}
.leaflet-left .leaflet-control-scale {
	margin-left: 5px;
	}
.leaflet-bottom .leaflet-control-scale {
	margin-bottom: 5px;
	}
.leaflet-control-scale-line {
	border: 2px solid #777;
	border-top: none;
	line-height: 1.1;
	padding: 2px 5px 1px;
	font-size: 11px;
	white-space: nowrap;
	overflow: hidden;
	-moz-box-sizing: border-box;
	     box-sizing: border-box;

	background: #fff;
	background: rgba(255, 255, 255, 0.5);
	}
.leaflet-control-scale-line:not(:first-child) {
	border-top: 2px solid #777;
	border-bottom: none;
	margin-top: -2px;
	}
.leaflet-control-scale-line:not(:first-child):not(:last-child) {
	border-bottom: 2px solid #777;
	}

.leaflet-touch .leaflet-control-attribution,
.leaflet-touch .leaflet-control-layers,
.leaflet-touch .leaflet-bar {
	box-shadow: none;
	}
.leaflet-touch .leaflet-control-layers,
.leaflet-touch .leaflet-bar {
	border: 2px solid rgba(0,0,0,0.2);
	background-clip: padding-box;
	}


/* popup */

.leaflet-popup {
	position: absolute;
	text-align: center;
	margin-bottom: 20px;
	}
.leaflet-popup-content-wrapper {
	padding: 1px;
	text-align: left;
	border-radius: 12px;

",["^ ","adminregion",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","name","World","2-alphacode","1W","TableName","World","Latesttradedata","2016","SpecialNotes","World aggregate.","LongName","World","WB-2code","1W","ShortName","World","financeName","World"]],"id",["^ ","^4","atom","^17","WLD"],"incomelevel",["^ ","^4","atom"],"locationType",["^ ","^4","atom","^17","region"],"locations",["^ ","^4","atom","^17",["AW","AF","AO","AL","AD","AE","AR","AM","AS","AG","AU","AT","AZ","BI","BE","BJ","BF","BD","BG","BH","BS","BA","BY","BZ","BM","BO","BR","BB","BN","BT","BW","CF","CA","CH","JG","CL","CN","CI","CM","CD","CG","CO","KM","CV","CR","CU","CW","KY","CY","CZ","DE","DJ","DM","DK","DO","DZ","EC","EG","ER","ES","EE","ET","FI","FJ","FR","FO","FM","GA","GB","GE","GH","GI","GN","GM","GW","GQ","GR","GD","GL","GT","GU","GY","HK","HN","HR","HT","HU","ID","IM","IN","IE","IR","IQ","IS","IL","IT","JM","JO","JP","KZ","KE","KG","KH","KI","KN","KR","KW","LA","LB","LR","LY","LC","LI","LK","LS","LT","LU","LV","MO","MF","MA","MC","MD","MG","MV","MX","MH","MK","ML","MT","MM","ME","MN","MP","MZ","MR","MU","MW","MY","NA","NC","NE","NG","NI","NL","NO","NP","NR","NZ","OM","PK","PA","PE","PH","PW","PG","PL","PR","KP","PT","PY","PS","PF","QA","RO","RU","RW","SA","SD","SN","SG","SB","SL","SV","SM","SO","RS","SS","ST","SR","SK","SI","SE","SZ","SX","SC","SY","TC","TD","TG","TH","TJ","TM","TL","TO","TT","TN","TR","TV","TZ","UG","UA","UY","US","UZ","VC","VE","VG","VI","VN","VU","WS","XK","YE","ZA","ZM","ZW"]],"^25",["^ ","^4","atom","^17","World"],"region",["^ ","^4","atom"]]],"indicatorMeta",["^ ","^2",["^ ","License_Type",["^ ","^4","atom","^17","CC BY-4.0"],"License_URL",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"WDITable",["^ ","^4","atom","^17","2.18"],"decimal",["^ ","^4","atom","^17",0],"description",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","Generalcomments","This is the Sustainable Development Goal indicator 2.1.1[https://unstats.un.org/sdgs/metadata/].","Statisticalconceptandmethodology","Data on undernourishment are from the Food and Agriculture Organization (FAO) of the United Nations and measure food deprivation based on average food available for human consumption per person, the level of inequality in access to food, and the minimum calories required for an average person.","Aggregationmethod","Weighted average","Periodicity","Annual","^2C","CC BY-4.0","Developmentrelevance","Good nutrition is the cornerstone for survival, health and development. Well-nourished children perform better in school, grow into healthy adults and in turn give their children a better start in life. Well-nourished women face fewer risks during pregnancy and childbirth, and their children set off on firmer developmental paths, both physically and mentally (UNICEF www.childinfo.org).","Source","Food and Agriculture Organization (http://www.fao.org/publications/en/).","Longdefinition","Population below minimum level of dietary energy consumption (also referred to as prevalence of undernourishment) shows the percentage of the population whose food intake is insufficient to meet dietary energy requirements continuously. Data showing as 5 may signify a prevalence of undernourishment below 5%.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","sourceNote","Population below minimum level of dietary energy consumption (also referred to as prevalence of undernourishment) shows the percentage of the population whose food intake is insufficient to meet dietary energy requirements continuously. Data showing as 5 may signify a prevalence of undernourishment below 5%.","Limitationsandexceptions","From a policy and program standpoint, this measure has its limits. First, food insecurity exists even where food availability is not a problem because of inadequate access of poor households to food. Second, food insecurity is an individual or household phenomenon, and the average food available to each person, even corrected for possible effects of low income, is not a good predictor of food insecurity among the population. And third, nutrition security is determined not only by food security but also by the quality of care of mothers and children and the quality of the household's health environment (Smith and Haddad 2000).","Topic","Health: Nutrition","shortname","Prevalence of undernourishment","sourceOrganization","Food and Agriculture Organization (http://www.fao.org/publications/en/).","fullname","Prevalence of undernourishment (% of population)","IndicatorName","Prevalence of undernourishment (% of population)"]],"^2T",["^ ","^4","atom","^17","Prevalence of undernourishment (% of population)"],"id",["^ ","^4","atom","^17","SN.ITK.DEFC.ZS"],"last_year",["^ ","^4","atom","^17",[2018,["LR","IS","LT","BN","BJ","SV","RO","MT","CV","NP","ES","MR","PH","SI","KH","GR","OM","SZ","RW","MX","BF","KE","CU","TN","KW","MK","VN","PY","HU","EE","MN","SL","T3","GH","AR","HN","ML","LU","NZ","PE","FJ","JM","BD","PT","KG","PL","RU","CL","AO","CO","TH","SK","TL","ID","AE","MO","DM","BW","T4","KR","AU","KZ","WS","BA","CY","DZ","KP","DK","DE","SB","CM","SD","RS","IN","LV","CG","AT","T7","UY","CN","HT","T2","NL","LK","MY","NI","TM","AZ","TG","PF","MW","ET","LS","IR","US","MM","MZ","GE","ZA","UA","CA","GB","SN","ME","BE","TR","JO","GY","CZ","MG","GT","TT","PA","CR","AM","NG","VE","BO","AL","DO","CI","TD","ST","BZ","MU","T6","VC","IT","BB","IQ","NC","GM","BG","NA","SA","EC","AF","NO","FI","IE","XG","EG","IL","FR","VU","HK","SE","HR","MA","GA","LB","UZ","BR","CH","PK","TZ","JP","SR","BY","T5","ZT","KI"]]],"relatedIndicators",["^ ","^4","atom","^17",["SN.ITK.MSFI.ZS","SN.ITK.VITA.ZS","SN.ITK.SVFI.ZS","SN.ITK.SALT.ZS","SE.PRM.TCAQ.ZS","SL.EMP.VULN.ZS","SE.PRM.PRSL.ZS","SH.MMR.DTHS","SP.POP.2529.FE.5Y"]],"^2R",["^ ","^4","atom","^17","Prevalence of undernourishment"],"source",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Population below minimum level of dietary energy consumption (also referred to as prevalence of undernourishment) shows the percentage of the population whose food intake is insufficient to meet dietary energy requirements continuously. Data showing as 5 may signify a prevalence of undernourishment below 5%."],"^2S",["^ ","^4","atom","^17","Food and Agriculture Organization (http://www.fao.org/publications/en/)."],"sourceURL",["^ ","^4","atom","^17","http://www.fao.org/publications/en/"],"topics",["^ ","^4","atom","^17",[["^ ","id","8","^17","Health "]]],"unit",["^ ","^4","atom","^17","percent"]],"^1V",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom"],"^2F",["^ ","^4","atom","^17",1],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2L","Food insecurity at moderate levels of severity is typically associated with the inability to regularly eat healthy, balanced diets. As such, high prevalence of food insecurity at moderate levels can be considered a predictor of various forms of diet-related health conditions in the population, associated with micronutrient deficiency and unbalanced diets. Severe levels of food insecurity, on the other hand, imply a high probability of reduced food intake and therefore can lead to more severe forms of undernutrition, including hunger. FAO has identified the FIES as the tool with the greatest potential for becoming a global standard capable of providing comparable information on food insecurity experience across countries and population groups to track progress on reducing food insecurity and\nhunger","^2I","The assessment is conducted using data collected with the Food Insecurity Experience Scale or a compatible experience-based food security measurement questionnaire (such as the HFSSM). The probability to be food insecure is estimated using the one-parameter logistic Item Response Theory model (the Rasch model) and thresholds for classification are made cross country comparable by calibrating the metrics obtained in each country against the FIES global reference scale, maintained by FAO. The threshold to classify \"moderate or severe\" food insecurity corresponds to the severity associated with the item \"having to eat less\" on the global FIES scale. It is an indicator of lack of food access.The indicator is calculated as an average over 3 years (eg. data for 2015 is the average of 2014-2016 data).","^2K","Annual","^2Q","Health","^2M","Food and Agriculture Organization of the United Nations (FAO)","^2N","The percentage of people in the population who live in households classified as moderately or severely food insecure. A household is classified as moderately or severely food insecure when at least one adult in the household has reported to have been exposed, at times during the year, to low quality diets and might have been forced to also reduce the quantity of food they would normally eat because of a lack of money or other resources.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","The percentage of people in the population who live in households classified as moderately or severely food insecure. A household is classified as moderately or severely food insecure when at least one adult in the household has reported to have been exposed, at times during the year, to low quality diets and might have been forced to also reduce the quantity of food they would normally eat because of a lack of money or other resources.","^2C","CC BY-4.0","^2T","Prevalence of moderate or severe food insecurity in the population (%)","^2S","Food and Agriculture Organization of the United Nations (FAO)","^2R","Prevalence of moderate or severe food insecurity in the population","^2U","Prevalence of moderate or severe food insecurity in the population (%)"]],"^2T",["^ ","^4","atom","^17","Prevalence of moderate or severe food insecurity in the population (%)"],"id",["^ ","^4","atom","^17","SN.ITK.MSFI.ZS"],"^2V",["^ ","^4","atom","^1 iarrhea. In low- and middle-income countries, where vitamin A is consumed largely in fruits and vegetables, daily per capita intake is often insufficient to meet dietary requirements. Providing young children with two high-dose vitamin A capsules a year is a safe, cost-effective, efficient strategy for eliminating vitamin A deficiency and improving child survival. Giving vitamin A to new breastfeeding mothers helps protect their children during the first few months of life. Food fortification with vitamin A is being introduced in many developing countries.","^2J","Weighted average","^2K","Annual","^2Q","Health: Nutrition","^2M","United Nations Children's Fund, State of the World's Children.","^2N","Vitamin A supplementation refers to the percentage of children ages 6-59 months old who received at least two doses of vitamin A in the previous year.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","Vitamin A supplementation refers to the percentage of children ages 6-59 months old who received at least two doses of vitamin A in the previous year.","^2C","CC BY-4.0","^2T","Vitamin A supplementation coverage rate (% of children ages 6-59 months)","^2S","United Nations Children's Fund, State of the World's Children.","^2R","Vitamin A supplementation coverage rate","^2U","Vitamin A supplementation coverage rate (% of children ages 6-59 months)"]],"^2T",["^ ","^4","atom","^17","Vitamin A supplementation coverage rate (% of children ages 6-59 months)"],"id",["^ ","^4","atom","^17","SN.ITK.VITA.ZS"],"^2V",["^ ","^4","atom","^17",[2017,["LR","BJ","NP","TJ","KH","SZ","RW","KE","ZW","VN","MN","SL","GH","ML","BD","AO","UG","TL","ID","GQ","BW","KP","CM","SD","CG","SO","LA","HT","LK","NE","SS","AZ","TG","MW","ET","LS","BI","MM","MZ","ZA","MV","SN","MG","GT","ZM","NG","BO","CI","TD","ST","T6","GM","NA","AF","GN","XG","KM","MA","UZ","GW","PK","TZ","CD","KI"]]],"^2W",["^ ","^4","atom","^17",["SN.ITK.DEFC.ZS","SN.ITK.MSFI.ZS","SN.ITK.SVFI.ZS","SN.ITK.SALT.ZS","SE.PRM.TCAQ.ZS","SL.EMP.VULN.ZS","SE.PRM.PRSL.ZS","SH.MMR.DTHS","SP.POP.2529.FE.5Y"]],"^2R",["^ ","^4","atom","^17","Vitamin A supplementation coverage rate"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Vitamin A supplementation refers to the percentage of children ages 6-59 months old who received at least two doses of vitamin A in the previous year."],"^2S",["^ ","^4","atom","^17","United Nations Children's Fund, State of the World's Children."],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^17",[["^ ","id","8","^17","Health "]]],"^2[",["^ ","^4","atom","^17","percent"]],"^1X",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom"],"^2F",["^ ","^4","atom","^17",1],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2L","Food insecurity at moderate levels of severity is typically associated with the inability to regularly eat healthy, balanced diets. As such, high prevalence of food insecurity at moderate levels can be considered a predictor of various forms of diet-related health conditions in the population, associated with micronutrient deficiency and unbalanced diets. Severe levels of food insecurity, on the other hand, imply a high probability of reduced food intake and therefore can lead to more severe forms of undernutrition, including hunger. FAO has identified the FIES as the tool with the greatest potential for becoming a global standard capable of providing comparable information on food insecurity experience across countries and population groups to track progress on reducing food insecurity and\nhunger","^2I","The assessment is conducted using data collected with the Food Insecurity Experience Scale or a compatible experience-based food security measurement questionnaire (such as the HFSSM). The probability to be food insecure is estimated using the one-parameter logistic Item Response Theory model (the Rasch model) and thresholds for classification are made cross country comparable by calibrating the metrics obtained in each country against the FIES global reference scale, maintained by FAO. The threshold to classify \"severe\" food insecurity corresponds to the severity associated with the item \"having not eaten for an entire day\" on the global FIES scale. It is an indicator of lack of food access.The indicator is calculated as an average over 3 years (eg. data for 2015 is the average of 2014-2016 data).","^2K","Annual","^2Q","Health","^2M","Food and Agriculture Organization of the United Nations (FAO)","^2N","The percentage of people in the population who live in households classified as severely food insecure. A household is classified as severely food insecure when at least one adult in the household has reported to have been exposed, at times during the year, to several of the most severe experiences described in the FIES questions, such as to have been forced to reduce the quantity of the food, to have skipped meals, having gone hungry, or having to go for a whole day without eating because of a lack of money or other resources.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","The percentage of people in the population who live in households classified as severely food insecure. A household is classified as severely food insecure when at least one adult in the household has reported to have been exposed, at times during the year, to several of the most severe experiences described in the FIES questions, such as to have been forced to reduce the quantity of the food, to have skipped meals, having gone hungry, or having to go for a whole day without eating because of a lack of money or other resources.","^2C","CC BY-4.0","^2T","Prevalence of severe food insecurity in the population (%)","^2S","Food and Agriculture Organization of the United Nations (FAO)","^2R","Prevalence of severe food insecurity in the population","^2U","Prevalence of severe food insecurity in the population (%)"]],"^2T",["^ ","^4","atom","^17","Prevalence of severe food insecurity in the population (%)"],"id",["^ ","^4","atom","^17","SN.ITK.SVFI.ZS"],"^2V",["^ ","^4","atom","^17",[2018,["LR","MD","IS","LT","SV","RO","MT","NP","ES","MR","PH","KH","GR","SZ","MX","BF","TN","ZW","KW","MK","HU","EE","MN","SL","GH","AR","HN","LU","NZ","BD","PT","RU","CL","UG","SK","ID","BW","AU","BA","DZ","DK","DE","SD","RS","LV","AT","UY","NL","SS","MY","MW","ET","IR","US","MZ","GE","UA","GB","SN","ME","BE","GT","CR","AM","LY","NG","AL","MU","IT","GM","BG","NA","AF","NO","FI","GN","IE","SG","EG","IL","FR","SE","HR","UZ","BR","CH","JP"]]],"^2W",["^ ","^4","atom","^17",["SN.ITK.DEFC.ZS","SN.ITK.MSFI.ZS","SN.ITK.VITA.ZS","SN.ITK.SALT.ZS","SE.PRM.TCAQ.ZS","SL.EMP.VULN.ZS","SE.PRM.PRSL.ZS","SH.MMR.DTHS","SP.POP.2529.FE.5Y"]],"^2R",["^ ","^4","atom","^17","Prevalence of severe food insecurity in the population"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","The percentage of people in the population who live in households classified as severely food insecure. A household is classified as severely food insecure when at least one adult in the household has reported to have been exposed, at times during the year, to several of the most severe experiences described in the FIES questions, such as to have been forced to reduce the quantity of the food, to have skipped meals, having gone hungry, or having to go for a whole day without eating because of a lack of money or other resources."],"^2S",["^ ","^4","atom","^17","Food and Agriculture Organization of the United Nations (FAO)"],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^17",[["^ ","id","8","^17","Health "]]],"^2[",["^ ","^4","atom","^17","percent"]],"^1Y",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom","^17","2.19"],"^2F",["^ ","^4","atom","^17",0],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2H","Iodine deficiency is the single most important cause of preventable mental retardation, contributes significantly to the risk of stillbirth and miscarriage, and increases the incidence of infant mortality. A diet low in iodine is the main cause of iodine deficiency. It usually occurs among populations living in areas where the soil has been depleted of iodine. If soil is deficient in iodine, then so are the plants grown in it, including the grains and vegetables that people and animals consume. There are almost no countries in the world where iodine deficiency has not been a public health problem. Many newborns in low- and middle-income countries remain unprotected from the lifelong consequences of brain damage associated with iodine deficiency disorders, which affect a child's ability to learn and to earn a living as an adult, and in turn prevents children, communities, and countries from fulfilling their potential (UNICEF, www.childinfo.org). Widely used and inexpensive, iodized salt is the best source of iodine, and a global campaign to iodize edible salt is significantly reducing the risks associated with iodine deficiency.","^2I","Most of the data on consumption of iodized salt are derived from household surveys. For the data that are from household surveys, the year refers to the survey year.","^2J","Weighted average","^2K","Annual","^2L","Iodine deficiency can lead to a variety of health and developmental consequences known as iodine deficiency disorders (IDDs). Iodine deficiency is a major cause of preventable mental retardation. It is especially damaging during pregnancy and in early childhood. In their most severe forms, IDDs can lead to cretinism, stillbirth and miscarriage; even mild deficiency can cause a significant loss of learning ability.  Thus, it is crucially important that pregnant women and young children in particular get adequate levels of iodine.\nIDD can easily be prevented at low cost, however, with small quantities of iodine. One of the best and least expensive methods of preventing iodine deficiency disorder is by simply iodizing table salt, which is currently done in many countries. It represents one of the easiest and most cost-effective interventions for social and economic development.","^2M","United Nations Children's Fund, Division of Data, Analysis, Planning and Monitoring (2019). UNICEF Global Databases on Iodized salt, New York, June 2019","^2N","Percentage of households which have salt they used for cooking that tested positive (>0ppm) for presence of iodine.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","Percentage of households which have salt they used for cooking that tested positive (>0ppm) for presence of iodine.","^2C","CC BY-4.0","^2Q","Health: Nutrition","^2T","Consumption of iodized salt (% of households)","^2S","United Nations Children's Fund, Division of Data, Analysis, Planning and Monitoring (2019). UNICEF Global Databases on Iodized salt, New York, June 2019","^2R","Consumption of iodized salt","^2U","Consumption of iodized salt (% of households)"]],"^2T",["^ ","^4","atom","^17","Consumption of iodized salt (% of households)"],"id",["^ ","^4","atom","^17","SN.ITK.SALT.ZS"],"^2V",["^ ","^4","atom","^17",[2018,["BJ","PE","KG","AL","IQ"]]],"^2W",["^ ","^4","atom","^17",["SN.ITK.DEFC.ZS","SN.ITK.MSFI.ZS","SN.ITK.VITA.ZS","SN.ITK.SVFI.ZS","SE.PRM.TCAQ.ZS","SL.EMP.VULN.ZS","SE.PRM.PRSL.ZS","SH.MMR.DTHS","SP.POP.2529.FE.5Y"]],"^2R",["^ ","^4","atom","^17","Consumption of iodized salt"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Percentage of households which have salt they used for cooking that tested positive (>0ppm) for presence of iodine."],"^2S",["^ ","^4","atom","^17","United Nations Children's Fund, Division of Data, Analysis, Planning and Monitoring (2019). UNICEF Global Databases on Iodized salt, New York, June 2019"],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^17",[["^ ","id","8","^17","Health "]]],"^2[",["^ ","^4","atom","^17","percent"]],"^1Z",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom","^17","2.1"],"^2F",["^ ","^4","atom","^17",0],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2L","Trained teachers refer to teaching force with the necessary pedagogical skills to teach and use teaching materials in an effective manner. The share of trained teachers reveals a country's commitment to investing in the development of its human capital engaged in teaching.\n\nTeachers are important resource, especially for children who are the first-generation of receiving education in their families and heavily rely on teachers in acquiring basic literacy skills. However, rapid increase in enrollments may cause the shortage of trained teachers. Education finance is a key for appropriate teacher allocations, since teacher salaries account for a large share of education budgets. The shortage of trained teacher may result in low qualified teachers in more disadvantaged area.","^2I","Share of trained teachers is calculated by dividing the number of trained teachers of the specified level of education by total number of teachers at the same level of education, and multiplying by 100. \n\nData on education are collected by the UNESCO Institute for Statistics from official responses to its annual education survey. All the data are mapped to the International Standard Classification of Education (ISCED) to ensure the comparability of education programs at the international level. The current version was formally adopted by UNESCO Member States in 2011. \n\nThe reference years reflect the school year for which the data are presented. In some countries the school year spans two calendar years (for example, from September 2010 to June 2011); in these cases the reference year refers to the year in which the school year ended (2011 in the example).","^2J","Weighted average","^2K","Annual","^2Q","Education: Inputs","^2M","UNESCO Institute for Statistics (http://uis.unesco.org/). Data as of September 2020.","^2N","Trained teachers in primary education are the percentage of primary school teachers who have received the minimum organized teacher training (pre-service or in-service) required for teaching in a given country.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","Trained teachers in primary education are the percentage of primary school teachers who have received the minimum organized teacher training (pre-service or in-service) required for teaching in a given country.","^2C","CC BY-4.0","^2P","This indicator does not take into account differences in teachers' experiences and status, teaching methods, teaching materials, and classroom conditions - all factors that affect the quality of teaching and learning. Some teachers without formal training may have acquired equivalent pedagogical skills through professional experience. In addition, national standards regarding teacher qualifications and pedagogical skills may vary.","^2T","Trained teachers in primary education (% of total teachers)","^2S","UNESCO Institute for Statistics (http://uis.unesco.org/). Data as of September 2020.","^2R","Trained teachers in primary education","^2U","Trained teachers in primary education (% of total teachers)"]],"^2T",["^ ","^4","atom","^17","Trained teachers in primary education (% of total teachers)"],"id",["^ ","^4","atom","^17","SE.PRM.TCAQ.ZS"],"^2V",["^ ","^4","atom","^17",[2020,["MC","BT"]]],"^2W",["^ ","^4","atom","^17",["SE.PRM.TCAQ.MA.ZS","SE.PRM.TCAQ.FE.ZS","SE.PRM.PRSL.ZS","SE.PRM.NINT.FE.ZS","SE.PRM.PRSL.MA.ZS","SE.PRM.ENRL","SE.PRM.ENRR","SE.PRM.ENRR.FE","SE.PRM.TENR.FE"]],"^2R",["^ ","^4","atom","^17","Trained teachers in primary education"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Trained teachers in primary education are the percentage of primary school teachers who have received the minimum organized teacher training (pre-service or in-service) required for teaching in a given country."],"^2S",["^ ","^4","atom","^17","UNESCO Institute for Statistics (http://uis.unesco.org/). Data as of September 2020."],"^2Y",["^ ","^4","atom","^17","http://uis.unesco.org/"],"^2Z",["^ ","^4","atom","^17",[["^ ","id","4","^17","Education "]]],"^2[",["^ ","^4","atom","^17","percent"]],"^1[",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom","^17","1.2"],"^2F",["^ ","^4","atom","^17",0],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2L","Breaking down employment information by status in employment provides a statistical basis for describing workers' behaviour and conditions of work, and for defining an individual's socio-economic group. A high proportion of wage and salaried workers in a country can signify advanced economic development. If the proportion of own-account workers (self-employed without hired employees) is sizeable, it may be an indication of a large agriculture sector and low growth in the formal economy. A high proportion of contributing family workers  generally unpaid, although compensation might come indirectly in the form of family income  may indicate weak development, little job growth, and often a large rural economy.\n\nEach status group faces different economic risks, and contributing family workers and own-account workers are the most vulnerable - and therefore the most likely to fall into poverty. They are the least likely to have formal work arrangements, are the least likely to have social protection and safety nets to guard against economic shocks, and often are incapable of generating sufficient savings to offset these shocks.","^2I","The indicator of status in employment distinguishes between two categories of the total employed. These are: (a) wage and salaried workers (also known as employees); and (b) self-employed workers. Self-employed group is broken down in the subcategories: self-employed workers with employees (employers), self-employed workers without employees (own-account workers), members of producers' cooperatives and contributing family workers (also known as unpaid family workers). Vulnerable employment refers to the sum of contributing family workers and own-account workers.\n\nData are derived using ILO modeled estimate series which are harmonized to ensure comparability across countries and over time by accounting for differences in data source, scope of coverage, methodology, and other country-specific factors. The estimates are based mainly on nationally representative labor force surveys, with other sources (population censuses and nationally reported estimates) used only when no survey data are available.","^2J","Weighted average","^2K","Annual","^2Q","Social Protection & Labor: Economic activity","^2M","Derived using data from International Labour Organization, ILOSTAT database. The data retrieved on January 29, 2021.","^2N","Vulnerable employment is contributing family workers and own-account workers as a percentage of total employment.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","Vulnerable employment is contributing family workers and own-account workers as a percentage of total employment.","^2C","CC BY-4.0","^2P","Data are drawn from labor force surveys and household surveys, supplemented by official estimates and censuses for a small group of countries. Due to differences in definitions and coverage across countries, there are limitations for comparing data across countries and over time even within a country. Estimates of women in employment are not comparable internationally, reflecting that demographic, social, legal, and cultural trends and norms determine whether women's activities are regarded as economic.","^2T","Vulnerable employment, total (% of total employment) (modeled ILO estimate)","^2S","Derived using data from International Labour Organization, ILOSTAT database. The data retrieved on January 29, 2021.","^2R","Vulnerable employment, total","^2U","Vulnerable employment, total (% of total employment) (modeled ILO estimate)"]],"^2T",["^ ","^4","atom","^17","Vulnerable employment, total (% of total employment) (modeled ILO estimate)"],"id",["^ ","^4","atom","^17","SL.EMP.VULN.ZS"],"^2V",["^ ","^4","atom","^17",[2020,["LR","MD","IS","LT","BN","BJ","SV","JG","RO","MT","CV","NP","ES","MR","TJ","PH","SI","KH","GR","OM","SZ","RW","MX","BF","KE","CU","TN","ZW","KW","MK","VN","PY","HU","ER","EE","SY","MN","SL","T3","GH","AR","HN","ML","LU","NZ","PE","FJ","JM","BD","PT","KG","PL","RU","CL","VI","AO","UG","CO","TH","SK","TL","ID","AE","MO","GQ","BW","T4","KR","DJ","AU","KZ","WS","BA","CY","DZ","KP","LC","DK","DE","SB","CM","SD","PR","RS","IN","LV","CG","AT","T7","SO","UY","LA","CN","HT","BH","T2","NL","LK","NE","YE","TO","SS","MY","NI","TM","AZ","TG","PF","MW","ET","LS","IR","BI","US","GU","MM","MZ","GE","ZA","MV","UA","CA","CF","GB","SN","ME","BE","TR","JO","GY","CZ","MG","GT","PS","TT","PA","CR","AM","ZM","LY","NG","VE","BO","AL","DO","CI","TD","ST","BZ","MU","T6","VC","IT","BB","IQ","NC","GM","BG","BT","NA","SA","EC","AF","NO","FI","GN","IE","XG","SG","KM","EG","IL","FR","VU","HK","SE","HR","MA","GA","LB","UZ","BR","CH","BS","GW","PK","TZ","JP","SR","PG","QA","CD","BY","T5","ZT"]]],"^2W",["^ ","^4","atom","^17",["SL.EMP.VULN.FE.ZS","SL.EMP.VULN.MA.ZS","SL.EMP.1524.SP.FE.NE.ZS","SL.EMP.1524.SP.FE.ZS","SL.EMP.1524.SP.ZS","SL.EMP.MPYR.ZS","SL.EMP.TOTL.SP.FE.ZS","SL.EMP.WORK.FE.ZS","SL.EMP.MPYR.MA.ZS"]],"^2R",["^ ","^4","atom","^17","Vulnerable employment, total"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Vulnerable employment is contributing family workers and own-account workers as a percentage of total employment."],"^2S",["^ ","^4","atom","^17","Derived using data from International Labour Organization, ILOSTAT database. The data retrieved on January 29, 2021."],"^2Y",["^ ","^4","atom"],"^2Z",["^ ","^4","atom","^17",[["^ ","id","10","^17","Social Protection & Labor"],["^ ","id","2","^17","Aid Effectiveness "]]],"^2[",["^ ","^4","atom","^17","percent"]],"^20",["^ ","^2C",["^ ","^4","atom","^17","CC BY-4.0"],"^2D",["^ ","^4","atom","^17","https://datacatalog.worldbank.org/public-licenses#cc-by"],"^2E",["^ ","^4","atom"],"^2F",["^ ","^4","atom","^17",0],"^2G",["^ ","^4","atom"],"en",["^ ","^4","atom","^17",["^ ","^2L","The cohort survival rate measures an education system's holding power and internal efficiency. Rates approaching 100 percent indicate high retention and low dropout levels.","^2I","Cohort survival rate is calculated by dividing the total number of children belonging to a cohort who reached each successive grade of the specified level of education by the number of children in the same cohort; those originally enrolled in the first grade of primary education, and multiplying by 100. To reflect current patterns of grade transition, it is calculated based on the reconstructed cohort method, which uses data on enrollment by grade for the two most recent years and data on repeaters by grade for the most recent of those two years. \nData on education are collected by the UNESCO Institute for Statistics from official responses to its annual education survey. All the data are mapped to the International Standard Classification of Education (ISCED) to ensure the comparability of education programs at the international level. The current version was formally adopted by UNESCO Member States in 2011. \n\nThe reference years reflect the school year for which the data are presented. In some countries the school year spans two calendar years (for example, from September 2010 to June 2011); in these cases the reference year refers to the year in which the school year ended (2011 in the example).","^2J","Weighted average","^2K","Annual","^2Q","Education: Efficiency","^2M","UNESCO Institute for Statistics (http://uis.unesco.org/). Data as of September 2020.","^2N","Persistence to last grade of primary is the percentage of children enrolled in the first grade of primary school who eventually reach the last grade of primary education. The estimate is based on the reconstructed cohort method.","^2D","https://datacatalog.worldbank.org/public-licenses#cc-by","^2O","Persistence to last grade of primary is the percentage of children enrolled in the first grade of primary school who eventually reach the last grade of primary education. The estimate is based on the reconstructed cohort method.","^2C","CC BY-4.0","^2P","The estimates have limitations in capturing real trend in that an observed rate will be applied to the underlying indicators such as repetition rate and promotion rate throughout the cohort life, and re-entrants, grade skipping, migration or transfers during a school year are not adequately captured.","^2T","Persistence to last grade of primary, total (% of cohort)","^2S","UNESCO Institute for Statistics (http://uis.unesco.org/). Data as of September 2020.","^2R","Persistence to last grade of primary, total","^2U","Persistence to last grade of primary, total (% of cohort)"]],"^2T",["^ ","^4","atom","^17","Persistence to last grade of primary, total (% of cohort)"],"id",["^ ","^4","atom","^17","SE.PRM.PRSL.ZS"],"^2V",["^ ","^4","atom","^17",[2019,["DJ"]]],"^2W",["^ ","^4","atom","^17",["SE.PRM.PRSL.MA.ZS","SE.PRM.PRSL.FE.ZS","SE.PRM.TCAQ.ZS","SE.PRM.NINT.FE.ZS","SE.PRM.ENRL","SE.PRM.ENRR","SE.PRM.ENRR.FE","SE.PRM.TENR.FE","SE.PRM.TCAQ.MA.ZS"]],"^2R",["^ ","^4","atom","^17","Persistence to last grade of primary, total"],"^2X",["^ ","^4","atom","^17","2"],"^2O",["^ ","^4","atom","^17","Persistence to last grade of primary is the percentage of children enrolled in the first grade of primary school who eventually reach the last grade of primary education. The estimate is based on the reconstructed cohort method."],"^2S",["^ ","^4","atom","^17
